import { Box, Typography } from "@mui/material";
import React from "react";

function Checkout() {
  return (
    <Box>
      <Container>
        <Typography
          variant="body1"
          sx={{
            fontWeight: "bold",
          }}
        >
          Billing details
        </Typography>
      </Container>
    </Box>
  );
}

export default Checkout;
